import Footer from '../../Footer/Footer';

function Home() {

    return (
        <>
            <Header/>
            <HomeContentGoals/>
            <HomeContentMedia/>
            <HomeContentLogin/>
            <Footer/>
        </>
    );
}

export default Home;
